import React from 'react'
import {BrowserRouter, Route, Link} from "react-router-dom";
import createBrowserHistory from "history/createBrowserHistory";
import GraciaFinal from '../epilogue/Main'
import Interlude from '../Interlude/Main'

const history = createBrowserHistory();

const Menu = () => (
    <BrowserRouter history={history}>
        <div className={'menu-container'}>
            <nav>
                <Link to="/">Interlude</Link>
                {/*<a href="#">Interlude</a>*/}
                <Link to="/graciafinal">Gracia: Final</Link>
                {/*<a href="#">Gracia: Final</a>*/}
                <a href="#">Gracia: Epilogue</a>
                <a href="#">Freya</a>
                <a href="#">High Five 5</a>
                <a href="#">Classic</a>
            </nav>
        </div>

        <Route exact path="/" component={Interlude}/>
        <Route path="/graciafinal" component={GraciaFinal}/>
    </BrowserRouter>
);

export default Menu
